        {id: "5", name:"Sweater Weather", cost:24, size:"3", season:"Fall", burntime:"5", pic:"https://www.bathandbodyworks.com/dw/image/v2/BBDL_PRD/on/demandware.static/-/Sites-master-catalog/default/dwf2edaa5e/hires/026154795.jpg?sh=471"},
        {id: "6", name:"Cactus Blossom", cost:9, size:"1", season:"Spring", burntime:"2", pic:"https://www.bathandbodyworks.com/dw/image/v2/BBDL_PRD/on/demandware.static/-/Sites-master-catalog/default/dw7085ba0f/hires/023940815.jpg?sh=471"},
        {id: "7", name:"Peach Bellini", cost:14, size:"3", season:"Spring", burntime:"4", pic:""},
